import React from "react";
import { Col } from "react-bootstrap";

const ResumeItem = (props) => (
  <Col>
    <h4>{props.title}</h4>
    <h5>{props.subhead}</h5>
    <p>{props.text}</p>
    <p>{props.text2}</p>
  </Col>
);

export default ResumeItem;
